import React, { Component } from 'react';
import HeaderBox from '../../components/UI/HeaderBox/HeaderBox';

class MenuContainer extends Component {
    render() {
        return (
            <React.Fragment>
                <HeaderBox  link="menu"
                            title="MENU"
                            caption="Food \\u0026 Drink"
                >
                </HeaderBox>
            </React.Fragment>
        );
    }
}

export default MenuContainer;
